const toDo = [
  {
    id: 1,
    task: "Fazer compras de supermercado",
    completed: false,
  },
  {
    id: 2,
    task: "Ir ao médico para check-up",
    completed: true,
  },
  {
    id: 3,
    task: "Concluir projeto do trabalho",
    completed: false,
  },
  {
    id: 4,
    task: "Lavar o carro",
    completed: false,
  },
  {
    id: 5,
    task: "Planejar as férias",
    completed: false,
  },
  {
    id: 6,
    task: "Ligar para a família",
    completed: true,
  },
];

export { toDo };
